            <section data-markdown>
                <textarea data-template>
                  ## HTNG "Move to the cloud"
                  What is HTNG ?
                  ---
                  ## HTNG is ...
                  > A connectivity to update restrictions, prices and availibility ...

                  > ... Maintained by Jerome and Atos ...

                  > ... and Hosted on the ACCOR ESB
                  ---
                  ## Context
                  - 💀 ACCOR Tibco ESB End Of Life
                  - ☁️ "Move to the Cloud" ongoing project on ACCOR
                  - 💰 ESB high monthly costs
                  - ⬆️ Scalability issues
                  - 💣 Complex ACCOR team organisation
                  ---
                  ## How to fix that ?
                  ---
                  With the Cross team engineer experts !
                  ---
                  ## Our mission
                  - We help you to do technical migration/architecture in a complex organisation
                  - We share with our peers (TARS/D-Edge standalone)
                  - We are hands-on first
                  ---
                  ## Audit
                  - 🚀 Move fast, break things (safely fail and learn)
                  - 📊 Functional and Non functional requirements audit
                  - 💲 FinOps to plan and analyse savings
                  ---
                  ## Plan
                  🗺️ Design and POC the architecture to plan the move
                  ---
                  ## Do it
                  - 🧑‍🤝‍🧑 Pair programming / contribution with D-Edge Dev / Ops and SAAS ACCOR/Atos team (aws, terraform, splunk)
                  - 🏭 CI/CD
                  - 💻 Kata
                  - 🛠️ Refactoring
                  - 📈 Observability
                  - 🏁 Safe rollout
                </textarea>
